import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
  return (
    <nav className="NavBar">
      <NavLink exact to="/">
        Vending Machine
      </NavLink>
      <NavLink exact to="/Chips">
        Chips
      </NavLink>
      <NavLink exact to="/Soda">
       Soda
      </NavLink>
      <NavLink exact to="/Candy">
       Candy
      </NavLink>
    </nav>
  );
}

export default NavBar;
